import OrderCard from './OrderCard';

const OrderList = ({ orders }) => {
  if (!orders.length) {
    return (
      <p style={{ marginTop: 20, opacity: 0.7 }}>
        ❌ Chưa có đơn hàng nào
      </p>
    );
  }

  return (
    <div className="order-list">
      {orders.map((o) => (
        <OrderCard key={o.orderId} order={o} />
      ))}
    </div>
  );
};

export default OrderList;
